def run(value_list):
    """
    Calculates the average net income for 2018 and 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """
    net_income_2018 = []
    net_income_2019 = []

    for item in value_list:
        if item['category'] == 'Net Income' and item['header1'] == 'April 28, 2018':
            net_income_2018.append(float(item['number_value']))
        elif item['category'] == 'Net Income' and item['header1'] == 'April 27, 2019':
            net_income_2019.append(float(item['number_value']))

    if net_income_2018 and net_income_2019:
        average_net_income = (sum(net_income_2018) + sum(net_income_2019)) / len(net_income_2018) + sum(net_income_2019) / len(net_income_2019)
        return (round(average_net_income, 2), 'million')
    elif net_income_2018:
        return (round(sum(net_income_2018) / len(net_income_2018), 2), 'million')
    elif net_income_2019:
        return (round(sum(net_income_2019) / len(net_income_2019), 2), 'million')
    else:
        return (0.0, 'million')

