def run(value_list):
    """
    Calculates the average value for sales per square metre for both F19 and F18.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the average value and its scale.
    """
    f19_sales_per_sq_m = 0
    f18_sales_per_sq_m = 0
    count = 0

    for item in value_list:
        if item['header1'] == 'F19':
            f19_sales_per_sq_m = item['number_value']
            count += 1
        elif item['header1'] == 'F18 (3)':
            f18_sales_per_sq_m = item['number_value']
            count += 1

    if count == 2:
        average = (f19_sales_per_sq_m + f18_sales_per_sq_m) / 2
        return (round(average, 2), 'million')
    elif count == 1:
        return (round(f19_sales_per_sq_m, 2), 'million')
    else:
        return (0.0, 'million')

