def run(value_list):
    """
    Calculates the average net cash provided by operating activities from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    op_activities_2019 = []
    op_activities_2018 = []

    for item in value_list:
        if item['category'] == 'Net cash provided by operating activities':
            if item['header1'] == '2019':
                op_activities_2019.append(float(item['number_value']))
            elif item['header1'] == '2018':
                op_activities_2018.append(float(item['number_value']))
            elif item['header1'] == 'Change':
                continue

    if op_activities_2018 and op_activities_2019:
        average = (sum(op_activities_2018) + sum(op_activities_2019)) / len(op_activities_2018) + (sum(op_activities_2018) + sum(op_activities_2019)) / len(op_activities_2018) / 2
        return (round(average, 2), 'million')
    else:
        return (0.00, '')

